import React from 'react';
const portugueseArray = [
  { name: 'sobre nós', route: 'sobre-nos' },
  { name: 'nosso négocio', route: 'nosso-negocio' },
  { name: 'clientes', route: 'clientes' },
  { name: 'empresas', route: 'empresas' },
  { name: 'contato', route: 'contato' },
];
const englishArray = [
  'about us',
  'our business',
  'clients',
  'companies',
  'contact',
];

function buttonPages(text) {
  return <button>{text}</button>;
}

function Header({ language = 'eng' }) {
  const namePages = language === 'br' ? portugueseArray : englishArray;

  return (
    <header>
      <div>
        <div>
          <img src="../images/svg/logo.svg" alt="logo"></img>
        </div>
        <div>{namePages.map(link => buttonPages(link))}</div>
      </div>
    </header>
  );
}

export default Header;
